(11266,	'70ELM6Q',	'$2y$10$fS7TmhOwtMx6FfTj4jGetumpcYi53DmfAPGbBR2upVEcyyoBVsyx6',	'rustmlisahil76@gmail.com',	'SAHİL',	'RÜSTƏMLİ',	'ŞAHİN OĞLU',	1,	'2001-08-19',	'AZƏRBAYCAN, BƏRDƏ; OTUZİKİLƏR K.',	'Azəri',	3,	1,	'BƏRDƏ ray., OTUZİKİLƏR K.',	'Xətai rayonu NZS qəsəbəsi',	'0506616386',	'Mənim güclü tərəflərimdən biri insanlarla tez və rahat şəkildə əlaqə qurmağım və doğru ünsiyyət tonunu tapma bacarığımdır. Ünsiyyət qurma, sadəcə danışmaq deyil, həm də qarşındakını dinləmək, onun duyğularını və ehtiyaclarını anlamqdır. İnsanlarla əlaqəyə girərkən, ilk növbədə onlara qarşı açıq fikirli və empatik olmaq vacibdir. Bu, qarşımdakı şəxsin özünü rahat hiss etməsinə və daha səmimi bir münasibət qurmağa kömək edir.\r\n\r\nİnsanlar çox vaxt düşünürlər ki, yaxşı ünsiyyət yalnız sözlərdən ibarətdir, amma məncə, ünsiyyətin əsasını dinləmə və qavrama təşkil edir. Qarşındakının nələr hiss etdiyini, nə istədiyini anlamaq və ona uyğun cavablar vermək, effektiv əlaqə qurmağın açarıdır. Bu bacarığı həm şəxsi, həm də peşəkar həyatda çox effektiv istifadə edirəm. Mənim üçün hər bir ünsiyyət qarşılıqlı anlaşma və münasibətlərin qurulmasına yönəlmiş bir prosesdir. İstər dostlarım, istərsə də işgüzar tərəfdaşlarımla yaxşı əlaqələr yaratmaq, qarşılıqlı etimad və hörmət üzərində qurulmuş münasibətlər inkişaf etdirmək önəmlidir.\r\n\r\nEyni zamanda, ünsiyyət qurarkən sadə və dürüst olmaq, qarışıq və mürəkkəb dil istifadə etməkdən çəkinmək də mənim üçün vacibdir. Mənim məqsədim qarşımda olan insanın anlayacağı şəkildə fikrimi ifadə etməkdir ki, qarşılıqlı anlaşma tam təmin olunsun. Həm də insanlar arası əlaqələrdə açıq fikirli olmaq çox önəmlidir, çünki bəzən fərqli baxış açılarından bəhrələnmək həm özümü, həm də başqalarını inkişaf etdirir.\r\n\r\nSonuç olaraq, insanların bir-birini daha yaxşı başa düşməsi və rahat şəkildə ünsiyyət qurması, sağlam və uğurlu əlaqələr üçün ən əsas amillərdən biridir. Bu mənim həyatımda daim ön planda saxladığım və inkişaf etdirdiyim bacarıqdır.',	NULL,	NULL,	0,	