(11440,	'7WBG9UX',	'$2y$10$lV5FfhlcUsUHYPNmNjLa9.2VKWyLEIOML3gjxfTj7/1p3RNoO.WDy',	'cemilehasanquliyeva@gmail.com',	'CƏMİLƏ',	'HASANQULİYEVA',	'İBADƏT QIZI',	2,	'2006-08-25',	'AZƏRBAYCAN, BAKI',	'Azərbaycan',	3,	1,	'CƏBRAYIL RAYONU, SAFARŞA KƏNDİ',	'Qaradağ rayonu,Müşviqabad qəsəbəsi',	'0558370014',	'Mən Cəmilə Hasanquliyeva — Azərbaycan Dillər Universitetinin tələbəsiyəm. Alman dili müəllimliyi ixtisası üzrə təhsil alıram və gələcəkdə bir şirkətdə yüksək vəzifədə çalışmaq məqsədim var. Dil öyrənmək mənim üçün sadəcə dərs deyil, bir həyat tərzidir. İngilis və Alman dillərini çox sevirəm, xüsusilə də ingilis dili mənim üçün ilhamverici bir vasitədir.\r\n\r\nTədqiqat aparmaq, yeni biliklər əldə etmək və düşüncələrimi genişləndirmək mənim üçün əvəzolunmazdır. Ətraf mühitin qorunması, gənclərin rolu və qadın hüquqları kimi sosial məsələlərə dərin marağım var. Feminist olaraq qadın və uşaq haqlarını müdafiə etməyi özümə borc bilirəm.\r\n\r\nMənim üçün ilham mənbələrindən biri də Princess Diana-dır. Onun şəfqəti, güclü xarakteri və humanist fəaliyyəti mənim dəyərlərimə çox yaxındır. Uşaqlığım Bakıda keçsə də, əslən Cəbrayıldanam və bu mənim kimliyimin mühüm hissəsidir.\r\n\r\nSəyahət etməyi sevirəm – xüsusilə İngiltərə, Yaponiya, Koreya və Almaniya kimi ölkələrin mədəniyyəti, yeməkləri və tarixi məkanları mənim üçün olduqca maraqlıdır. Koreya dili öyrənmək də mənim sevimli məşğuliyyətlərimdən biridir.',	NULL,	NULL,	0,	0,	1,	'2025-03-05 15:20:26',	NULL,	'2025-03-04 16:03:33',	'2025-04-14 19:31:39',	'2022-11-29',	'2032-11-28',	'Asan 1',	'AA4556142',	'[\"2\"]'),
