(11487,	'6L454F5',	'$2y$10$kezRgLjxJTVxvdvv6uPJFOXVWhfuGwcStFvtXJgoKZ7WLGkAHyJtW',	'mahmudlurevan169@gmail.com',	'RƏVAN',	'MAHMUDLU',	'FƏZAİL OĞLU',	1,	'2005-08-21',	'AZƏRBAYCAN, BAKI',	'Azərbaycan',	3,	1,	'ZƏNGİLAN RAYONU, ŞAYIFLI Ə/D, ŞAYIFLI KƏNDİ,',	'ABŞERON Stansiya Sumqayıt qəsəbəsi, Kristal Abşeron Bina 61, Mənzil 21.',	'0555575587',	'Mən, Rəvan, hələ uşaqlıqdan cəmiyyətə töhfə verməyi, daim öyrənməyi və aktiv fəaliyyət göstərməyi qarşıma məqsəd qoymuşam. 4-cü sinifdə \"Heydərçi Gənclər\" fəxri diplomuna layiq görülərək vətənpərvərlik ruhunu erkən yaşlarımdan mənimsəmişəm. 5-ci sinifdə isə məktəbimizin təşkil etdiyi şahmat yarışında uğur qazanmışam – bu oyun yalnız bir hobi deyil, eyni zamanda strateji düşüncə və analiz bacarıqlarımı inkişaf etdirməyimdə mühüm rol oynayıb. Şahmata olan marağım isə hələ də davam edir.\r\n\r\nVətənimə və cəmiyyətimə faydalı olmaq prinsipini əsas tutaraq prezident seçkilərində müşahidəçi kimi iştirak etmişəm. Dövlət səviyyəsində həyata keçirilən bu mühüm prosesdə yer almaq, demokratik dəyərlərin qorunmasına töhfə vermək mənim üçün böyük qürur idi. Bu, təkcə bir vəzifə deyil, həm də vətəndaş məsuliyyətimin bir göstəricisi idi.\r\n\r\nHazırda Azərbaycan Dövlət Neft və Sənaye Universitetinin Kimya Texnologiya Fakültəsinin Tələbə Gənclər Təşkilatının (TGT) koordinatoruyam və sosial fəaliyyətlərdə, könüllülük işlərində aktiv iştirak edirəm. ATGT-nin təşkil etdiyi tədbirlərdə fəal iştirak etmişəm, Formula 1 vasitəsilə futbolla bağlı könüllülük təcrübəsi qazanmışam. Bu cür beynəlxalq tədbirlərdə yer almaq mənə komanda işi, təşəbbüskarlıq və operativ qərarvermə bacarıqlarımı gücləndirmək imkanı yaradıb.\r\n\r\nTəcrübələrim və iştirak etdiyim festivallar\r\nYeni biliklər və bacarıqlar əldə etmək, insanlarla ünsiyyət qurmaq və ətrafıma töhfə vermək mənim üçün daim prioritet olub. Bu səbəbdən bir sıra genişmiqyaslı festivallarda iştirak etmişəm:\r\n\r\nCOLD Fest\r\nFEST101\r\n\"A+\" PARTY\r\nGenZFEST\r\n\r\nBu festivallar mənim üçün təkcə əyləncə platforması deyil, eyni zamanda şəbəkələşmə, idarəetmə və təşkilatçılıq bacarıqlarımı təkmilləşdirmək üçün bir fürsət olub.\r\n\r\nMəqsədim və Dəyərlərim\r\nHər zaman ətrafıma dəyər qatmaq, sosial və ictimai fəaliyyətlərdə aktiv olmaq mənim əsas prinsiplərimdəndir. Liderlik və təşkilatçılıq bacarıqlarımı daha da inkişaf etdirmək üçün sosial layihələrdə və könüllülük fəaliyyətlərində iştirak etməyə davam edirəm. Mənim üçün könüllülük təkcə bir fəaliyyət deyil, cəmiyyətə fayda verməyin, insanlara dəstək olmağın və özünü inkişaf etdirməyin ən gözəl yoludur.\r\n\r\nGələcəkdə daha genişmiqyaslı tədbirlərdə və layihələrdə iştirak edərək öyrəndiklərimi tətbiq etməyi və yeni zirvələr fəth etməyi hədəfləyirəm. Vətənim üçün, cəmiyyətim üçün və öz inkişafım üçün daim çalışacağam.',	NULL,	NULL,	0,	1,	1,	'2025-03-04 19:46:40',	NULL,	'2025-03-04 19:37:34',	'2025-04-15 09:50:32',	'2021-09-03',	'2031-09-02',	'Asan 1',	'AA3144079',	NULL),
