(12056,	'6GV81FE',	'$2y$10$OtdsbLQBkKbA8164NI6iLOF7wf/TMPxO9amByBTrgJuy21R6InUVa',	'nuraymamishova@gmail.com',	'NURAY',	'MƏMİŞOVA',	'XASAY QIZI',	2,	'2006-12-21',	'AZƏRBAYCAN, BAKI',	'Azərbaycan',	3,	1,	'BAKI ŞƏHƏRİ, XƏTAİ RAYONU, 2945 MƏHƏLLƏSİ, MƏHƏMMƏD HADİ KÜÇƏSİ, , MƏNZİL 35',	'Xudu Məmmədov 25G',	'0513414176',	'Mənim əsas hobbilərimdən biri musiqi dinləməkdir. Musiqi mənim üçün həm əyləncə, həm də rahatlıq mənbəyidir. Müxtəlif janrlarda mahnılar dinləməyi sevirəm və bu, həm ingilis dili biliklərimi inkişaf etdirməyə, həm də mədəniyyətlər haqqında daha çox öyrənməyə kömək edir.Bundan əlavə, xarici dillərlə maraqlanıram və ingilis dilini öyrənməyi davam etdirirəm. Gələcəkdə peşəkar ingilis dili müəllimi olmaq istəyirəm və bu sahədə özümü inkişaf etdirməyə çalışıram.Xüsusi bacarıqlarıma gəldikdə isə, ünsiyyət qurmaq və insanlarla yaxşı münasibət yaratmaq bacarığım var. Müəllimlik peşəsinə maraq göstərdiyim üçün izah etməyi və başqalarına kömək etməyi sevirəm. Həmçinin, mətnlər yazmaq, təqdimatlar hazırlamaq və araşdırma aparmaq bacarıqlarım da var.',	'https://m.facebook.com/profile.php?mibextid=wwXIfr&mibextid=wwXIfr',	NULL,	0,	0,	1,	'2025-03-09 14:31:06',	NULL,	'2025-03-09 14:17:16',	'2025-03-09 14:31:06',	'2023-02-05',	'2033-02-04',	'Asan 6',	'AA4794423',	NULL),
