(15456,	'7X0DEQM',	'$2y$10$S05CTCXtkYvse9tT9yL.Ruxn90CRSiLYG7CKYTSGKlHBquoE2u7D6',	'ndirayeva@gmail.com',	'NƏRMİN',	'DİRAYEVA',	'MƏHƏRRƏM QIZI',	2,	'2006-05-31',	'AZƏRBAYCAN, BAKI',	'Azərbaycan',	3,	1,	'ZAQATALA RAYONU, DANAÇI Ə/D, DANAÇI KƏNDİ',	'Bakı şəhəri,Xətai rayonu',	'0507827626',	'Mən Nərmin Dirayeva, Azərbaycan Dövlət Neft və Sənaye Universitetinin 2-ci kurs tələbəsiyəm.İxtisasım İnformayia Texnologiyalarıdır.Texnologiyaya olan böyük marağım məni daim öyrənməyə, yenilikləri izləməyə və fərqli sahələrdə özümü inkişaf etdirməyə ruhlandırır. C# proqramlaşdırma dili ilə backend sahəsində təcrübəm var. Xüsusilə MVC və API əsaslı layihələr üzərində işləməyi sevirəm. SQL Server ilə verilənlər bazasının qurulması və idarə olunması üzrə də biliklərə malikəm.Şahmat oynamaq, yeni layihələr kəşf etmək və özümü daim inkişaf etdirmək mənim sevdiyim məşğuliyyətlərdəndir. Hər zaman sosial aktiv olmağa, yeni dostlar qazanmağa və sosial çevrəmi genişləndirməyə çalışıram. Gələcək karyeram üçün əvəzsiz olacaq təcrübələr qazanmaq mənim üçün çox önəmlidir.Könüllülük layihələrinə böyük marağım var. İnsanlara kömək etmək, cəmiyyətə töhfə vermək və eyni zamanda özümü inkişaf etdirmək mənə böyük motivasiya verir. Komanda ilə işləmək, liderlik bacarıqlarımı inkişaf etdirmək, ünsiyyət qurmaq, təzyiq altında düzgün qərarlar almaq və səmərəli işləmək kimi yumşaq bacarıqlarımı artırmağa çalışıram.Bu bacarıqların mənim gələcək kariyeramda çox böyük təsiri olacağına inanıram.Gələcək karyeram üçün faydalı ola biləcək sahələrə böyük marağım var və daim özümü inkişaf etdirmək arzusu ilə çalışıram.',	'https://www.facebook.com/share/18rNvGW9Hy/',	'https://www.linkedin.com/in/n%C9%99rmin-dirayeva-09aaa9295?utm_source=share&utm_campaign=share_via&utm_content=profile&utm_medium=android_app',	0,	0,	1,	'2025-04-12 12:08:09',	NULL,	'2025-04-12 11:40:21',	'2025-04-12 12:08:09',	'2022-06-28',	'2032-06-27',	'ZAQATALA  RPŞ QvŞV qrupu',	'AA3952396',	NULL),
