(15544,	'1CKBA4P',	'$2y$10$6u4s.5jlMiM4eFZgeLlNRuAbl9Cj/xioahaUntF4aAi6Qps7M0X06',	'ilahaalakbarsoy@gmail.com',	'İLAHƏ',	'ƏLƏKBƏROVA',	'FÜZULİ QIZI',	2,	'2000-09-08',	'AZƏRBAYCAN, UCAR; QAZYAN KƏNDİ',	'Azərbaycanlı',	3,	1,	'UCAR RAYONU, QAZYAN Ə/D, QAZYAN KƏNDİ',	'Füzuli Bayramov 28',	'0105165116',	'Mənim hobbilərim həm yaradıcılıq, həm də intellektual inkişafımı dəstəkləyən fəaliyyətlərdən ibarətdir:\r\n	•	Kitab oxumaq: Fərqli mövzularda kitab oxumaq mənə bilik və dünyagörüşümü artırmağa, yeni perspektivlər qazanmağa kömək edir. Xüsusilə, elmi və ədəbiyyat janrında əsərlər oxumaqdan zövq alıram.\r\n	•	Rəsm çəkmək: Yaradıcılıq qabiliyyətimi inkişaf etdirmək üçün rəsm çəkməklə məşğul oluram. Bu, həm də diqqət və səbr tələb edən bir məşğuliyyətdir.\r\n	•	Elmi araşdırma etmək: Fərqli mövzularda tədqiqat aparmaq və yeni məlumatlar öyrənmək mənim üçün böyük maraq doğurur. Akademik fəaliyyətim zamanı qazandığım təcrübə bu hobbi ilə daha dərindən məşğul olmağa imkan verir.\r\n	•	Dil öyrənmək: Yeni dilləri öyrənmək və mədəniyyətləri tanımaq mənim üçün maraqlı və faydalıdır. Azərbaycan, İngilis və Rus dillərini bilsəm də, daha çox dil öyrənməyi planlaşdırıram.\r\n	•	Marka kolleksiyası yığmaq: Fərqli ölkələrdən və mövzulardan olan markalar toplamaq mənim xüsusi maraq dairəmdir. Bu hobbi mənə dünyadakı müxtəliflikləri daha yaxşı anlamağa kömək edir.\r\n	•	Dil bilikləri: Azərbaycan (ana dili), İngilis və Rus dillərində ünsiyyət qurmaq bacarığı. Bu, beynəlxalq mühitdə işləmək üçün vacib bir üstünlükdür.\r\n	•	Ünsiyyət və müştəri xidməti: Müştərilərlə səmərəli ünsiyyət qurmaq, onların problemlərini həll etmək və məmnuniyyət səviyyəsini artırmaq bacarığı.\r\n	•	Analitik düşüncə və problem həll etmə: Akademik və peşəkar təcrübələrim vasitəsilə analitik düşünmə qabiliyyətimi inkişaf etdirmişəm, mürəkkəb məsələlərdə həll yolları tapmaqda çevikəm.\r\n	•	Yaradıcılıq və diqqətlilik: Yaradıcılıq tələb edən işlərdə uğurlu olmaqla yanaşı, detallara diqqət yetirmək bacarığım var.\r\n	•	Komanda işi və təşkilatçılıq: Komanda şəklində effektiv işləmək və tapşırıqları vaxtında və dəqiqliklə yerinə yetirmək bacarığına malikəm.\r\n	•	Texnoloji biliklər: MS Office proqramları (Word, Excel, PowerPoint) ilə işləmək bacarığı və texnoloji yeniliklərə tez uyğunlaşmaq qabiliyyəti.',	NULL,	NULL,	0,	0,	1,	'2025-04-12 22:10:32',	NULL,	'2025-04-12 21:07:44',	'2025-04-12 22:10:32',	'2024-10-17',	'2034-10-16',	'Asan 5',	'AA6437129',	NULL),
